import React, { Component } from "react";

export default class SignUp extends Component {

    constructor(props){
        super(props);
        this.onSubmit = this.onSubmit.bind(this);
        this.handleChange = this.handleChange.bind(this);
      }


    onSubmit(e) {
        console.log("Hello")
        console.log(e)
    }

    handleChange(e) {
        console.log("Handle Change")
        console.log(e)
    }

    render() {
        return (
            <div class="row" style={{paddingTop:100}}>
                <div class="col-md-4"></div>
                <div class="col-md-4">
            <form>
                <h3 >Register</h3>

                <div className="form-group">
                    
                    <input type="text" className="form-control" placeholder="First name" value={this.state.firstName} onChange={this.handleChange}/>
                </div>

                <div className="form-group">
                    
                    <input type="text" className="form-control" placeholder="Last name" value={this.state.lastName} onChange={this.handleChange}/>
                </div>

                <div className="form-group">
                    
                    <input type="email" className="form-control" placeholder="Enter email" value={this.state.email} onChange={this.handleChange}/>
                </div>

                <div className="form-group">
                    
                    <input type="password" className="form-control" placeholder="Enter password" value={this.state.password} onChange={this.handleChange}/>
                </div>

                <button type="submit" className="btn btn-primary btn-block" onClick={this.onSubmit}>Sign Up</button>
                <p className="forgot-password text-right">
                    Already registered ? <a href="/">Login here</a>
                </p>
            </form>
            </div><div class="col-md-4"></div>
            </div>
        );
    }
}
